import { Employee } from 'src/app/models/employee.model';

@Component({
  selector: 'app-employee-list',
  templateUrl: './employee-list.component.html',
  styleUrls: ['./employee-list.component.css']
})
export class EmployeeListComponent implements OnInit {
  employees: Employee[]=[
    {
      id: "U01";
      name: "Singthai Srisoi";
      email: "singthai@gmail.com";
      phone: "0179008950";
      salary: 20000;
      department: "IT";
    },
    {
      id: "U02";
      name: "Lee Cai Xuan";
      email: "caixuan@gmail.com";
      phone: "0123456789";
      salary: 21000;
      department: "IT";
    }
  ];
  constructor() { }

  ngOnInit(): void {
    this.employees.push();
  }
}
